import React from "react";
import { Container,Button } from "reactstrap";
const UserExist = () => {
  return (
    <div>
      <Container className="m-4  justify-content-center">
      <h2>Login to access the application</h2>
        <Button color="primary" className="m-4">Login</Button>
        <Button color="secondary" className="m-4">SignUp</Button>
      </Container>
    </div>
  );
};

export default UserExist;
